INSERT INTO `jbl-subwoofer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/JBL-Subwoofer/JBL BASSPRO Go - 2 in 1.webp;', 'JBL BASSPRO Go - 2 in 1', 'https://www.amazon.de/JBL-Subwoofer-Breitband-Lautsprecher-Bluetooth/dp/B08QZDXGH6/ref=sr_1_1?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=PXNWHN8GHJGT&keywords=JBL+BASSPRO+Go+-+2+in+1&qid=1667239045&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=jbl+clip+4+schwarz%2Caps%2C100&sr=8-1', '354,31', 3.7, 28, 0, 'JBL;Bodenstehend;App-Steuerung;Subwoofer;-;Der JBL BASSPRO Go ist ein aktiver Auto Subwoofer, der problemlos im Fahrzeug montiert und aufgeladen werden kann. Die Schnelltrennfunktion verwandelt ihn zum tragbaren JBL Bluetooth Lautsprecher, damit die Party draußen weitergehen kann|Der erste JBL Box seiner Art: Im Auto Subwoofer Modus produziert er satte, tiefe Bässe. Abgeklemmt verwandelt er in einen leistungsstarken JBL Bluetooth Box mit den typischen und bekanten JBL Partybox sound|Streamen zu dritt: Kabelloses Streaming über Bluetooth dank JBL Connect. Es können bis zu drei Geräte für Musik-Sharing im Social Mode und zwei BassPro Go Lautsprecher kabellos für simultane Audiowiedergabe verbinden, mit einer Reichweite von bis zu 38 m|8 Stunden Musik: Der integrierte NiMH-Akku sorgt für eine kabellose Wiedergabezeit von bis zu acht(!) Stunden. Mit dem BASSPRO Go geht auch dem Smartphone der Saft nicht mehr aus, denn es kann ganz einfach per USB-Kabel aufgeladen werden|Der BASSPRO Go ist Spritzwasser geschützt (IPX5) zur Verwendung im Freien. Außerdem hat Harman den JBL Lautsprecher im testverfahren bis an die Grenzen getrieben. JBL setzte de JBL Speaker extremer Kälte, Hitze und Erschütterungen aus und betrieb ihn tagelang bei voller Leistung');
INSERT INTO `jbl-subwoofer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/JBL-Subwoofer/JBL SW10.webp;', 'JBL SW10', 'https://www.amazon.de/JBL-SW10-kabelloser-Subwoofer-Schwarz/dp/B07VBBJKK3/ref=sr_1_1?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3PB15A2TXXPXA&keywords=JBL+SW10&qid=1667239051&qu=eyJxc2MiOiIwLjk0IiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=jbl+bass+pro+go+-+2+in+1%2Caps%2C64&sr=8-1', '219,00', 3.8, 18, 2, 'JBL;Bodenstehend;-;Subwoofer;300 Watt;Nur für die Verwendung mit JBL Link Bar, Ein-Knopf-Setup für einfache Verbindung mit der JBL Link Bar|Der 25,4 cm Tieftöner wurde entwickelt, um zusammen mit dem abgestimmten Bassreflexgehäuse zu arbeiten, um einen satten Bass zu liefern.|Bequeme flexible Platzierung ohne lästige Kabel.|Bassreflex-Port-Design – die Verwendung dieses abgestimmten Designs ermöglicht eine größere Ausgabe und tiefere Bässe.|Der SW10 ist die perfekte Ergänzung, wenn Sie auf der Suche nach echten JBL Pro Bass sind.');
INSERT INTO `jbl-subwoofer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (3, '../img/products/JBL-Subwoofer/Jbl Basspro Nano.webp;', 'Jbl Basspro Nano', 'https://www.amazon.de/JBL-SUBBPNANO/dp/B07YBPHBWX/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1LFSKH25N21U9&keywords=Jbl+Basspro+Nano&qid=1667239056&qu=eyJxc2MiOiIxLjIwIiwicXNhIjoiMC4zNyIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C61&sr=8-2', '172,25', 4.6, 178, 1, 'JBL;Bodenstehend;Fernbedienung;Subwoofer;-;Der BassPro NANO Auto-Subwoofer von JBL mit eingebautem Verstärker liefert tiefe Bässe und nimmt nur wenig Platz ein. JBLs kleinster aktiver Auto-Subwoofer kann an den kompaktesten Stellen versteckt werden wie unter dem sitz und liefert außergewöhnliche Leistung für jedes Car hifi System|Angetrieben von einem 100Watt RMS Subwoofer-Verstärker, liefert der BassPro Nano druckvolle, straffe Bässe, die du von JBL erwarten würdest, während er kühl läuft und nur minimalen Strom aus dem Ladesystem deines Fahrzeugs zieht|Der BassPro Nano verwendet Hochpassfilter und Limiter, die eine außergewöhnliche At-the-Limits-Performance liefern, damit du die Musik mit dem vom Musiker beabsichtigten Bass-Erlebnis genießen kannst|Der kleine Formfaktor des robusten Voll-Aluminium-Druckguss-Gehäuses minimiert nicht nur die Größe, sondern eliminiert auch Rasseln, um klare Bässe auf kleinstem Raum zu liefern|JBL Subwoofer und Lautsprecher müssen einen strengen Testprozess durchlaufen. JBL friert sie ein, backt sie, schüttelt sie, bestrahlt sie mit ultraviolettem Licht und betreibt sie tagelang mit voller Leistung');
INSERT INTO `jbl-subwoofer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (4, '../img/products/JBL-Subwoofer/JBL Club WS1200.webp;', 'JBL Club WS1200', 'https://www.amazon.de/JBL-Auto-HiFi-Subwoofer-Chassis-Lautsprecher/dp/B071J4VRR8/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=PO35SC9OEE83&keywords=JBL+Club+WS1200&qid=1667239062&sprefix=%2Caps%2C68&sr=8-2', '139,00', 4.7, 13, 3, 'JBL;Flush Montage;Touchpad Steuerung;Subwoofer;-;JBL CLUBWS1200 Auto-Subwoofer-Chassis 1000W 4â„¦|Inhalt: 1 Stück');
