INSERT INTO `jbl-subwoofer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (6, '../img/products/JBL-Subwoofer/JBL Stage 122D .webp;', 'JBL Stage 122D ', 'https://www.amazon.de/JBL-Stage-122D-30cm-Subwoofer/dp/B094X9QHHK/ref=sr_1_1_mod_primary_new?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3179UEAFJBSN1&keywords=JBL+Stage+122D&qid=1667239074&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sbo=RZvfv%2F%2FHxDF%2BO5021pAnSA%3D%3D&sprefix=%2Caps%2C67&sr=8-1', '89,00', 5.0, 2, 0, 'JBL;Flush Montage;-;Subwoofer;1000 Watt;Netzversorgung: 250 W rms; 1000 W Spitze|Empfindlichkeit (@2,83V): 91 dB|Frequenzgang: 34 Hz – 200 Hz|Durchmesser der Schwingspule: 50.8 mm (2"|JBL Boxen und JBL Auto Subwoofer Set durchlaufen einen strengen Testprozess, der viele andere Auto Lautsprecher zerstören würde. JBL Radio friert sie ein, backt sie, schüttelt sie, bestrahlt sie mit ultraviolettem Licht und betreibt sie tagelang mit voller Leistung');
INSERT INTO `jbl-subwoofer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (7, '../img/products/JBL-Subwoofer/JBL Stage 82.webp;', 'JBL Stage 82', 'https://www.amazon.de/JBL-Stage-82-Lautsprecher-Maximalleistung/dp/B09442ZVGP/ref=sr_1_1?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2G3NGEKWNBNVT&keywords=JBL+Stage+82&qid=1667239079&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C60&sr=8-1', '79,00', 4.3, 12, 0, 'JBL;Tischplatte;Fernsteuerung;Subwoofer;800 Watt;STAGE 82, 20cm Subwoofer, Maximale Belastbarkeit: 800 Watt, Nennbelastbarkeit: 200 Watt, Impedanz: 4 Ohm, Wirkungsgrad: 88dB, Frequenzgang: 38 Hz - 200 Hz, Außendurchmesser: 20,6 cm, Einbauausschnitt: 17,8 cm, Einbautiefe: 9,4 cm');
INSERT INTO `jbl-subwoofer` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (8, '../img/products/JBL-Subwoofer/JBL Stage 1010.webp;', 'JBL Stage 1010', 'https://www.amazon.de/JBL-Stage-1010-Auto-Subwoofer-225/dp/B074KMT947/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=11TWHXB4KVX6W&keywords=JBL+Stage+1010&qid=1667239084&qu=eyJxc2MiOiIwLjY5IiwicXNhIjoiMC42NSIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C73&sr=8-3', '69,90', 4.5, 26, 0, 'JBL;Flush Montage;-;Subwoofer;900 Watt;Polypropylen-Konusse und Gummisicken aus hochwertigen Materialien bieten eine reine Wiedergabe und hohe Stabilität|JBL-Lautsprecher werden einem strengen Testverfahren unterzogen, das weniger leistungsfähige Lautsprecher nicht bestehen würden|Die Lautsprecher sind sorgfältig abgestimmt, um einen hohen Schalldruckpegel und eine geringe Verzerrung zu gewährleisten|Das ist JBL – der Lautsprecher und der Sound, der Audio-Enthusiasten seit über 70 Jahren begeistert. Es gibt nichts Besseres als eine Fahrt mit JBL-Sound|Drei Größen für sämtliche Anwendungen, Umgebungen und Budgets');
